import React, { Component } from 'react'
import './Login.css';
export default class Login extends Component {
  render() {
    return (
      <div>
        <center>
         <h2 className="r7"> Rwenzori  Airlines Membership Log In Page</h2>
         <img src="https://encrypted-tbn0.gstatic.com/images?q=tbn:ANd9GcTC0HlQ_ckX6HqCAlqroocyRDx_ZRu3x3ezoA&usqp=CAU" className="r15" alt=""/>
         <label>UserName</label>
        </center>
      </div>
    )
  }
}
